import BusinessIcon from '@mui/icons-material/Business';
import BalanceIcon from '@mui/icons-material/Balance';
import MonetizationOnIcon from '@mui/icons-material/MonetizationOn';
import AccessibilityNewIcon from '@mui/icons-material/AccessibilityNew';
import InterpreterModeIcon from '@mui/icons-material/InterpreterMode';
import ConnectWithoutContactIcon from '@mui/icons-material/ConnectWithoutContact';

const services = [
  {
    id: "1",
    title: "Legal", 
    desc: "Eos tota dicunt democritum no. Has natum gubergren ne. Est viris soleat sadipscing cu. Eos tota dicunt democritum no.",
    icon: <BalanceIcon color="secondary"/>
  },
  {
    id: "2",
    title: "Marketing", 
    desc: "Eos tota dicunt democritum no. Has natum gubergren ne. Est viris soleat sadipscing cu. Eos tota dicunt democritum no.",
    icon: <ConnectWithoutContactIcon color="secondary"/>
  },
  {
    id: "3",
    title: "Media", 
    desc: "Eos tota dicunt democritum no. Has natum gubergren ne. Est viris soleat sadipscing cu. Eos tota dicunt democritum no.",
    icon: <InterpreterModeIcon color="secondary"/>
  },
  {
    id: "4",
    title: "Financial", 
    desc: "Eos tota dicunt democritum no. Has natum gubergren ne. Est viris soleat sadipscing cu. Eos tota dicunt democritum no.",
    icon: <MonetizationOnIcon color="secondary"/>
  },
  {
    id: "5",
    title: "Technology", 
    desc: "Eos tota dicunt democritum no. Has natum gubergren ne. Est viris soleat sadipscing cu. Eos tota dicunt democritum no.",
    icon: <BusinessIcon color="secondary"/>
  },
  {
    id: "6",
    title: "Live", 
    desc: "Eos tota dicunt democritum no. Has natum gubergren ne. Est viris soleat sadipscing cu. Eos tota dicunt democritum no.",
    icon: <AccessibilityNewIcon color="secondary"/>
  },
]

export default services;
